INSERT INTO `spzg_article` VALUES (4, 2, '清华大学校长、中国科学院院士邱勇代表：“线上+线下”教学模式应更受关注', 999, 1, '/filespath/images/20200813145256.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, '人人网', NULL, '新京报网', NULL, 36, '', '', '', '全国人大代表、清华大学校长、中国科学院院士邱勇在接受视频采访时介绍，清华大学在线教学在疫情期间发挥了重要作用。他认为，“线上+线下”混合教学模式会受到越来越多的关注。', '2020-08-13 14:52:58', '', 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, '<p style=\"text-indent: 2em;\">5月25日，全国人大代表、清华大学校长、中国科学院院士邱勇接受记者采访时谈起最近很火的&ldquo;后浪&rdquo;，邱勇表示，年轻人决定了我们的未来，对于&ldquo;后浪&rdquo;，他有信心。</p>\r\n&nbsp;\r\n\r\n<p style=\"text-indent: 2em;\">邱勇：这一批同学很不容易。高考本来就是很紧张的事情，给人很大的压力，今年的疫情给这批同学的学习带来很大的影响。在离高考还有几十天的时间里，我建议高三同学要把自己的心态调整好，做好最后一个阶段自己的时间安排。</p>\r\n&nbsp;\r\n\r\n<p style=\"text-indent: 2em;\">一些中学生给我本人写信，询问如何成为一名清华人。清华的校训是自强不息、厚德载物。我想，成为清华人最主要的就是要有自强的精神。</p>\r\n<br />\r\n<img alt=\"\" src=\"/public/home/images/imgl18.jpg\" />\r\n<p style=\"text-indent: 2em;\">邱勇：年轻人代表了社会的希望，年轻人的表现决定了我们的未来。我对年轻人是有信心的。&ldquo;后浪&rdquo;是一批有自信的人，这个时代赋予了他们宽广的视野。他们有朝气、很勇敢、敢于尝试。我认为他们是可靠的，是值得信赖的，中国的希望在他们身上。</p>\r\n&nbsp;\r\n\r\n<p style=\"text-indent: 2em;\">新京报：能不能举几个&ldquo;后浪&rdquo;的例子？</p>\r\n&nbsp;\r\n\r\n<p style=\"text-indent: 2em;\">邱勇：今年的五四表彰中，清华大学研究生支教团青海湟中分队获得由共青团中央、全国青联授予的第24届&ldquo;中国青年五四奖章集体&rdquo;。自2006年起，清华大学研究生支教团青海湟中分队开始在湟中县第一中学、职业技术学校连续14年开展支教工作，用优异的教学成果和扎实的公益服务赢得了师生的一致好评，为湟中教育发展、地方脱贫作出了积极贡献。</p>\r\n&nbsp;\r\n\r\n<p style=\"text-indent: 2em;\">还有，疫情期间，清华大学武汉籍学生张睿茹的英文演讲《疫情后，我读懂了万众一心》登上了热搜第一名，传播量超过了三个亿。张睿茹在春节假期回到家乡武汉，随后父母确诊住院，自己也被隔离观察。疫情期间她独自生活，感受很多、成长很多。她的演讲展示了年轻人对价值观、人性和社会的深入思考。很多年轻人在这个阶段经受住考验，他们的人生也一定会得到进一步的提升。</p>\r\n&nbsp;\r\n\r\n<p style=\"text-indent: 2em;\">邱勇：在北京市的支持下，清华大学建立了未来芯片技术高精尖创新中心和结构生物学等高精尖创新中心，这些都是对于科创中心建设的直接支持。</p>\r\n&nbsp;\r\n\r\n<p style=\"text-indent: 2em;\">北京的定位是&ldquo;全球&rdquo;科创中心，既然是&ldquo;全球&rdquo;，就一定要产生世界最高水平的科技成果。在这个方面，清华大学可以发挥自身的科技优势，作出积极的贡献。作为全球的科创中心，一定要有若干所全球最好的大学。当前，清华正在推进综合改革、加快&ldquo;双一流&rdquo;建设、实施全球战略，各方面都呈现出快速发展的态势。清华建设成为世界一流大学，本身就是对北京全球科创中心最重要的支持。</p>\r\n&nbsp;\r\n\r\n<p style=\"text-indent: 2em;\">新京报：怀柔科学城将建设多个重大科学项目，清华大学参与了哪些项目？</p>\r\n', 0, 0, 0);
