bsp;\r\n\r\n<p style=\"text-indent: 2em;\">新京报：怀柔科学城将建设多个重大科学项目，清华大学参与了哪些项目？</p>\r\n', 0, 0, 0);
INSERT INTO `spzg_article` VALUES (6, 4, '张恒亮', 999, 1, '/filespath/images/Banner/20200810141440.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 18, NULL, NULL, NULL, '', '2020-08-10 14:18:24', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>清华大学航天航空学院工程力学系教授，中国科学院院士。</p>\r\n\r\n<p>2009年起担任清华学堂钱学森班创办首席教授；2010年起担任清华大学微纳米力学与多学科交叉创新研究中心创办主任</p>\r\n', 5, 0, 0);
INSERT INTO `spzg_article` VALUES (7, 4, '李海', 999, 1, '/filespath/images/20200810142111.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, NULL, NULL, '2020-08-10 14:21:16', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>工学博士，现任清华大学教授，博士生导师1988年12月&nbsp;&nbsp; 硕士毕业后在清华大学工程力学系任助教，讲师；1994&nbsp;&nbsp; 清华大学工程力学系副教授；2004年&nbsp; 清华大学航天航空学院流体力学所教授</p>\r\n', 5, 0, 0);
INSERT INTO `spzg_article` VALUES (8, 4, '王洋', 999, 1, '/filespath/images/20200810142128.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9, NULL, NULL, NULL, NULL, '2020-08-10 14:21:35', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>清华大学行健书院院长、航天航空学院教授、博士生导师。清华大学教学委员会副主任，曾任清华大学副教务长、教务处处长。教育部力学类教指委副主任、中国科协动力学与控制首席科普专家、中国力学学会常务理事、《力学与实践》主编、IEEE TAES的AE以及中国科学、宇航学报、空间科学学报、空间控制技术与应用、力学快报等编委。主持近三届全国大学生力学竞赛、发起全国轨道竞赛</p>\r\n', 5, 0, 0);
INSERT INTO `spzg_article` VALUES (9, 4, '于丽', 999, 1, '/filespath/images/20200810142147.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 20, NULL, NULL, NULL, NULL, '2020-08-10 14:22:03', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>教授，博士生导师</p>\r\n\r\n<p>清华大学航天航空学院工程热物理研究所1997年3月获西安交通大学能源与动力工程学院工程热物理专业工学博士学位1991年3月获天津大学热能工程系工...程热物理专业工学硕士学位1988年7月获华中理工大学（华中科技大学）动力工程系工程热物理专业学士学位</p>\r\n', 5, 0, 0);
INSERT INTO `spzg_article` VALUES (10, 4, '海峡', 999, 1, '/filespath/images/20200810142224.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 35, NULL, NULL, NULL, NULL, '2020-08-10 14:22:28', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>陈常青，教授，博士生导师，国家杰出青年科学基金获得者。</p>\r\n\r\n<p>1997年毕业于西安交通大学，固体力学博士学位;1993年毕业于西安交通大学，工程力学学士学位</p>\r\n', 5, 0, 0);
INSERT INTO `spzg_article` VALUES (11, 4, '张强', 999, 1, '/filespath/images/20200810142302.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 33, NULL, NULL, NULL, NULL, '2020-08-10 14:23:08', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>白峰杉，教授，博士生导师</p>\r\n\r\n<p>1999-现在,清华大学数学科学系, 教授</p>\r\n\r\n<p>1995-1999,清华大学应用数学系, 副教授</p>\r\n\r\n<p>1991-1994,英国巴斯大学数学学院/美国斯坦福大学计算机系,博士后</p>\r\n', 5, 0, 0);
INSERT INTO `spzg_article` VALUES (12, 4, '王明', 999, 1, '/filespath/images/20200810142320.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '2020-08-10 14:33:04', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>张雄，教授，博士生导师，清华大学航天航空学院航空宇航工程系系主任</p>\r\n\r\n<p>1986年毕业于宁夏大学物理系，1989年7月和1992年7月分别获大连理工大学计算力学专业硕士和博士学位。1994年6...</p>\r\n', 3, 0, 0);
INSERT INTO `spzg_article` VALUES (13, 4, '刘良', 999, 1, '/filespath/images/20200810142337.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4, NULL, NULL, NULL, NULL, '2020-08-10 14:33:00', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>孙沛，清华大学脑与智能实验室研究员，清华大学社科学院心理学系副教授，博士生导师，Frontier in Educational Psychology杂志编委，主要研究方向为人类视觉信息加工的神经机制、 计算机视觉、情绪与老化...、创新人才选拔与培养、幸福企业和社区等方面。</p>\r\n', 3, 0, 0);
INSERT INTO `spzg_article` VALUES (14, 5, '首席教授 郑泉水', 999, 1, '/filespath/images/20200810145659.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15, NULL, NULL, NULL, NULL, '2020-08-10 14:57:01', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>清华大学航天航空学院工程力学系教授，中国科学院院士。</p>\r\n\r\n<p>2009年起担任清华学堂钱学森班创办首席教授；2010年起担任清华大学微纳米力学与多学科交叉创新研究中心创办主任</p>\r\n', 0, 0, 0);
INSERT INTO `spzg_article` VALUES (15, 5, '席教授 郑泉水', 999, 1, '/filespath/images/20200810145709.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 24, NULL, NULL, NULL, NULL, '2020-08-10 14:57:20', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>工学博士，现任清华大学教授，博士生导师1988年12月&nbsp;&nbsp; 硕士毕业后在清华大学工程力学系任助教，讲师；1994&nbsp;&nbsp; 清华大学工程力学系副教授；2004年&nbsp; 清华大学航天航空学院流体力学所教授</p>\r\n', 0, 0, 0);
INSERT INTO `spzg_article` VALUES (16, 5, '院系协调 李俊峰', 999, 1, '/filespath/images/20200810145733.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 21, NULL, NULL, NULL, NULL, '2020-08-10 14:57:39', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>清华大学行健书院院长、航天航空学院教授、博士生导师。清华大学教学委员会副主任，曾任清华大学副教务长、教务处处长。教育部力学类教指委副主任、中国科协动力学与控制首席科普专家、中国力学学会常务理事、《力学与实践》主编、IEEE TAES的AE以及中国科学、宇航学报、空间科学学报、空间控制技术与应用、力学快报等编委。主持近三届全国大学生力学竞赛、发起全国轨道竞赛</p>\r\n', 0, 0, 0);
INSERT INTO `spzg_article` VALUES (17, 5, '出国研学与实习 陈民', 999, 0, '/filespath/images/20200810145749.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, '2020-08-10 14:58:21', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>教授，博士生导师</p>\r\n\r\n<p>清华大学航天航空学院工程热物理研究所1997年3月获西安交通大学能源与动力工程学院工程热物理专业工学博士学位1991年3月获天津大学热能工程系工...程热物理专业工学硕士学位1988年7月获华中理工大学（华中科技大学）动力工程系工程热物理专业学士学位</p>\r\n', 0, 0, 0);
INSERT INTO `spzg_article` VALUES (18, 5, '出国研学与实习 陈民', 999, 1, '/filespath/images/20200810145749.jpg', NULL, '2020-08-10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 24, NULL, NULL, NULL, NULL, '2020-08-10 14:58:10', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>教授，博士生导师</p>\r\n\r\n<p>清华大学航天航空学院工程热物理研究所1997年3月获西安交通大学能源与动力工程学院工程热物理专业工学博士学位1991年3月获天津大学热能工程系工...程热物理专业工学硕士学位1988年7月获华中理工大学（华中科技大学）动力工程系工程热物理专业学士学位</p>\r\n', 0, 0, 0);
