INSERT INTO `spzg_article` VALUES (40, 21, '首席教授 郑泉水', 999, 1, '/filespath/images/20200811142441.jpg', NULL, '2020-08-11', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 21, NULL, NULL, NULL, '清华大学航天航空学院工程力学系教授， 中国科学院院士。', '2020-08-11 14:25:16', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>2009年起担任清华学堂钱学森班创办首席教授；2010年起担任清华大学微纳米力学与多学科交叉创新研究中心创办主任；2018年起担任深圳清华大学研究院超滑技术研究所所长。曾任清华大学工程力学系系主任、校学术委员会秘书长。曾任中国力学学会旗舰杂志《力学学报》和Acta Mechanica Sinica主编、中国力学学会学会副理事长。曾任南昌大学高等研究院创办院长和清华大学-以色列特拉维夫大学XIN中心创办主任。</p>\r\n&nbsp;\r\n\r\n<p>郑泉水在1980-90年代创建了完整的本构方程张量函数理论。新千年后开创了结构超滑（指两个固体表面全接触滑移时摩擦几乎为零、磨损为零的状态）理论与应用技术，并致力于拔尖创新型学生的培养。在这些领域，他于2004和2017年两次获得了国家自然科学奖二等奖（第一获奖人），2018年获得了国家级教学成果一等奖。所指导的博士生中有三名获得了全国优秀博士学位论文。</p>\r\n', 0, 0, 0);
INSERT INTO `spzg_article` VALUES (41, 21, '首席教授 郑泉水1', 999, 1, '/filespath/images/20200811142441.jpg', NULL, '2020-08-11', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 76, NULL, NULL, NULL, '清华大学航天航空学院工程力学系教授， 中国科学院院士。', '2020-08-11 14:42:06', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '<p>2009年起担任清华学堂钱学森班创办首席教授；2010年起担任清华大学微纳米力学与多学科交叉创新研究中心创办主任；2018年起担任深圳清华大学研究院超滑技术研究所所长。曾任清华大学工程力学系系主任、校学术委员会秘书长。曾任中国力学学会旗舰杂志《力学学报》和Acta Mechanica Sinica主编、中国力学学会学会副理事长。曾任南昌大学高等研究院创办院长和清华大学-以色列特拉维夫大学XIN中心创办主任。</p>\r\n&nbsp;\r\n\r\n<p>郑泉水在1980-90年代创建了完整的本构方程张量函数理论。新千年后开创了结构超滑（指两个固体表面全接触滑移时摩擦几乎为零、磨损为零的状态）理论与应用技术，并致力于拔尖创新型学生的培养。在这些领域，他于2004和2017年两次获得了国家自然科学奖二等奖（第一获奖人），2018年获得了国家级教学成果一等奖。所指导的博士生中有三名获得了全国优秀博士学位论文。</p>\r\n', 0, 0, 0);
