INSERT INTO `spzg_article` VALUES (44, 26, '科技创新挑战性问题头脑风暴主题征集', 999, 1, '/filespath/images/20200813141321.jpg', NULL, '2020-08-13', 0, NULL, NULL, NULL, '超级管理员', NULL, '新京报网', NULL, 4, NULL, NULL, NULL, 'X-Ideas：最好的学生-最好的导师-通过挑战Great Ideas链接，近现代科学技术发展史告诉我们，几乎任何一项伟大突破的背后都存在着两大基本要素：一个“疯狂”的想法、一份“十年磨一剑”的坚持。', '2020-08-13 14:27:33', NULL, 'shangpin', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, '', 0, 0, 0);
