INSERT INTO `spzg_columns` VALUES (9, 0, '招生', '本科生招生', 'ADMISSIONS', 999, 10, '|0|', 'Single', 1, '', 1, '/filespath/images/20200811105926.jpg', '', '2020-08-11 10:59:28', 0, 'shangpin', '<p>多年来，清华大学一直围绕 &quot;综合评价、多元择优、因才施招、促进公平&quot;的人才选拔理念实施本科生招生，特别关注农村优质生源，促进教育公平。目前，已基本形成高考、保送生、自主招生、领军人才选拔、高水平运动员、艺术特长生、国防/定向生、飞行学员班、贫困专项计划、港澳台侨、艺术类（美术学院）等招生类型。</p>\r\n&nbsp;\r\n\r\n<p>在党和国家全面深化改革的大背景下，清华大学将招生工作的定位和承担的使命进一步明确，提出&ldquo;招生工作必须助力教书育人，必须服务国家战略，必须力促教育公平&rdquo;，将招生工作统一到学校教育教学的各个环节之中，全方位落实&ldquo;招生服务培养，招生促进培养，招生就是培养&rdquo;的清华招生理念。</p>\r\n', 0, 'id', NULL, 0, NULL, '/filespath/images/20200811105646.png', NULL, NULL, NULL, '', NULL, NULL, 1, NULL, NULL, '', '', NULL, NULL, NULL, NULL);
