INSERT INTO `spzg_columns` VALUES (17, 16, '钱学森力学班综述', '', '', 999, 10, '|0|,|15|,|16|', 'Content', 1, '', 1, '', '', '2020-08-11 13:17:33', 0, 'shangpin', '<p>清华学堂人才培养计划钱学森力学班（简称钱学森班或TEEP）创立于2009年，是国家&ldquo;基础学科拔尖学生培养试验计划&rdquo;唯一定位于工科基础的试验班。其使命是：发掘和培养有志于通过技术改变世界、造福人类的创新型人才，探索回答&ldquo;钱学森之问&rdquo;。</p>\r\n&nbsp;\r\n\r\n<p>钱学森是清华大学航天航空学院工程力学系的前身&mdash;&ldquo;工程力学研究班&rdquo;的创办者。钱学森班的创办旨在秉承钱老的创新型人才培养思想，致力于构建一个开放型的创新教育模式，以有利于学生成长为工程技术领域具有健全人格、领导力和突出创新研究和发明能力的人才。</p>\r\n&nbsp;\r\n\r\n<p>钱学森班每年招收大学本科生30名，寻求能在大学期间及毕业后不断追求卓越、持续激励他人的学生。钱学森班创立了注重创新性人才培养的CRC（Course-Research-Community/课程-研究-社群）培养模式，其特色是以&ldquo;进阶式研究学习体系&rdquo;为牵引，引导学生自主学习、精深学习，勇于并坚持探索和创新，团队合作并激励他人。</p>\r\n&nbsp;\r\n\r\n<p style=\\\"margin-bottom: 8px;\\\">在Course方面，作为清华大学首个荣誉学位试点，钱学森班设置了荣誉学位培养方案，重点开设高强度荣誉课程，构建了独特定制的数学、自然科学、工程基础、研究实践、人文和综合贯通的六大模块深广兼备的课程体系，为学生奠定深厚的基础知识，并促进融会贯通。</p>\r\n&nbsp;\r\n\r\n<p>在Research方面，为学生设计了由大一、大二的X-ideas （开放创新重大问题）和ESRT（增强版学生研究训练）、大三的ORIC（开放性自主创新研究）、以及大四的SURF (出国研学与企业实习)组成的进阶式研究学习系统。其中ESRT是在学校SRT基础上的更高要求，钱学森班要求学生必修ESRT，建议学生至少需要进行三个以上方向的SRT项目，通过ESRT的科研初试，确定一个最为感兴趣的方向开启ORIC，开展更为深入的科研实践。钱学森班提倡通过研究来引导每位同学精深学习、构建自己独有的知识结构。学生在此过程将逐步提升自身的研究能力，同时寻找挚爱的研究方向，并由此注入&ldquo;技术创新基因&rdquo;。</p>\r\n&nbsp;\r\n\r\n<p>在Community方面，通过&ldquo;今日与未来&rdquo;对话、班友会、亲友日等形式，帮助学生扩大视野、树立远大志向，提倡朋辈学习，鼓励学生之间、学生与导师之间多交流，不断追求卓越、持续激励他人。</p>\r\n&nbsp;\r\n\r\n<p>钱学森班行政归属航天航空学院，其中航天航空学院、微纳米力学与多学科交叉研究中心为主要平台。</p>\r\n', 0, 'id', NULL, 0, NULL, '/filespath/images/20200811131730.jpg', NULL, NULL, NULL, '', NULL, NULL, 1, NULL, NULL, '', '', NULL, NULL, NULL, NULL);
INSERT INTO `spzg_columns` VALUES (18, 16, '重大事件', '', '', 999, 42, '|0|,|15|,|16|', 'Sjian', 1, '', 1, '', '', '2020-08-11 13:43:11', 0, 'shangpin', NULL, 0, 'id', NULL, 0, NULL, '', NULL, NULL, NULL, '/filespath/images/20200811134309.jpg', NULL, NULL, 1, NULL, NULL, '', '', NULL, NULL, NULL, NULL);
INSERT INTO `spzg_columns` VALUES (19, 16, '师资情况', '', '', 999, 10, '|0|,|15|,|16|', 'Single', 1, '', 1, '', '', '2020-08-11 13:22:42', 0, 'shangpin', '<p>钱学森班由首席教授郑泉水院士全面负责。钱学森班工作组由何枫教授担任项目主任，13位工作组成员分别来自清华大学航天航空学院、微纳米力学与多学科交叉研究中心、数学系、心理系等院系，承担钱学森班的管理和建设。工作组共有10名教授、2名副教授、1名副研究员，其中院士1名、国家杰出青年基金获得者1名、国家级教学名师奖获得者1名。钱学森班聘请来自航院、数学系、化学系、机械系等院系共23位知名教授为各年级学生单开小班课。钱学森班为大二年级开设国际学者暑期课程，截止到目前，已有来自加州理工学院、宾夕法尼亚大、学、以色列特拉维夫大学、法国巴黎高等工程师学院、瑞士巴塞尔大学、加拿大滑铁卢大学等全球顶尖学府的十多位知名教授参与授课。</p>\r\n', 0, 'id', NULL, 0, NULL, '', NULL, NULL, NULL, '/filespath/images/20200811132240.jpg', NULL, NULL, 1, NULL, NULL, '', '', NULL, NULL, NULL, NULL);
INSERT INTO `spzg_columns` VALUES (20, 16, '人才培养成果', '', '', 999, 10, '|0|,|15|,|16|', 'Cg', 1, '', 1, '', '', '2020-08-11 13:24:07', 0, 'shangpin', '<p>钱学森班已创办十周年，经过锲而不舍的探索实践，钱学森班师生们取得了以下有代表性的成绩：</p>\r\n&nbsp;\r\n\r\n<p>1. 持续吸引了高考、竞赛选拔和自主招生中的顶尖学生，连续9年在全清华理工科招生名列前茅。</p>\r\n&nbsp;\r\n\r\n<p>2. 钱学森班凝聚了越来越多的不仅来自清华，也来自全球范围、不同学科（工、理、文等）、以及企业和管理界的志同道合的优秀导师。钱学森班组织高年级同学进行出国研学与实习，所有同学都参与了海外知名院校或国内顶尖企业的研究实践。目前钱学森班已与华为、小米等知名企业建立定点实习合作关系。</p>\r\n&nbsp;\r\n\r\n<p>3. 截止至目前，钱学森班学生共发表论文54篇、发明专利23项、获得个人奖励荣誉260多人次，获奖人数占学生总人数的大约87%。钱学森班2012级学生开创了开放创新挑战研究与实践，2013级学生获得在包括清华大学优秀班级第一名在内的几乎所有的校级、市级班级荣誉，2015级学生外骨骼项目获得了清华大学2016年度清华大学SRT一等奖，2016级学生成为了清华大学本科荣誉学位首个试点，2017级学生获得了清华大学创意大赛新生专场决赛一等奖等等，2018级学生在第二届国际大学生工程力学竞赛亚洲赛区中获得特等奖。钱学森班每一届学生都有可圈可点的成绩。钱学森班学生科研实践成绩斐然，四次获得清华大学SRT一等奖，荣获日内瓦国际发明展金奖及银奖。2019年钱学森班未来系统实验室再创佳绩，荣获第十六&ldquo;挑战杯&rdquo;全国大学生课外学术科研作品竞赛特别一等奖，这是钱学森班学生第二次获得&ldquo;挑战杯&rdquo;一等奖。</p>\r\n&nbsp;\r\n\r\n<p>4. 截止至目前，钱学森班毕业生共计191人，毕业生去向基本按1（清华航院）:1（外院系,多数清华、少量外校）:1（海外读研）分布，海外读研的同学多数在麻省理工、哈佛大学、斯坦福大学、加州理工等国外顶尖高校继续深造。毕业生分别去往力学、航天航空、汽车、热能、土木、机械、材料、自动化、计算机科学与技术、生物医学工程等共计27个专业方向。钱学森班鼓励学生进入顶尖创新企业，有个别同学毕业后直接工作，1名2017届毕业生已经是航天一院十四所的某型号负责人。</p>\r\n', 0, 'id', NULL, 0, NULL, '/filespath/images/20200811132402.jpg', NULL, NULL, NULL, '', NULL, NULL, 1, NULL, NULL, '', '', NULL, NULL, NULL, NULL);
