INSERT INTO `spzg_content` VALUES (8144, '自有劳务施工人员', 5126, 999, '/filespath/images/Icon/20200513164842.png', '2020-05-13', '金环组建了自有劳务施工队，并负责施工人员的统一培训和管理，有效避免因为工程分包而带来的人员管理的困难。金环严格的用人和管理人的经验，渗透到工程的每一环节。', 1, '', 0, 'shangpin');
